syntax = "proto3";

package chromosomeAnalysisTestOrder;

message ChromosomeAnalysisTestOrder {
  string result = 1;
  string karyotype = 2;
  string interpretation = 3;
  string comment = 4;
  string metaphasesCounted = 5;
  string metaphasesAnalyzed = 6;
  string metaphasesKaryotyped = 7;
  string cultureType = 8;
  string bandingTechnique = 9;
  string bandingResolution = 10;
  string asr = 11;
}
